function Post({post}) {
    return (
        <div>
            <p>{post.postId}</p>
            <p>{post.title}</p>
            <p>{post.thumbnail}</p>
            {post.conditions.map(c => 
                <p>c</p>
            )}
            <p>{post.url}</p>
            <p>{post.closingDate}</p>
        </div>
    )
}

export default Post;
